import React from 'react';
import Form from './components/form.js';
import Title from './components/title.js';
import Message from './components/message.js';

import './styles.css';


class App extends React.Component {

  constructor(props){
    super(props)
    this.state = {
      input:'does it work',
    }
  }


  render() {
    return (
      <>
      <Title text = {this.state.input}/>
      <Message/>
      <Form/>
      </>
    );
  }
}

export default App;
